import React from "react";
import { Link } from "react-router-dom";

function FutureEventCard(props) {
  const { id, fEventName, imageUrl, date, time } = props.futureEvent;
  return (
    <div className="card shadow h-100">
      <img className="card-img-top" src={imageUrl} alt={fEventName} />
      <div className="card-body">
        <h4 className="card-title">{fEventName}</h4>
        <p className="card-text">{date} {time}</p>
        <Link to={`/futureevent/${id}`} className="stretched-link"></Link>
      </div>
    </div>
  );
}

export default FutureEventCard;
